openapi: 3.0.0
info:
  description: "NRF NFDiscovery Service.  \n© 2022, 3GPP Organizational Partners (ARIB,\
    \ ATIS, CCSA, ETSI, TSDSI, TTA, TTC).  \nAll rights reserved.\n"
  title: NRF NFDiscovery Service
  version: 1.3.0-alpha.2
externalDocs:
  description: 3GPP TS 29.510 V18.1.0; 5G System; Network Function Repository Services;
    Stage 3
  url: https://www.3gpp.org/ftp/Specs/archive/29_series/29.510/
servers:
- url: "{apiRoot}/nnrf-disc/v1"
  variables:
    apiRoot:
      default: https://example.com
      description: apiRoot as defined in clause 4.4 of 3GPP TS 29.501
security:
- {}
- oAuth2ClientCredentials:
  - nnrf-disc
- oAuth2ClientCredentials:
  - nnrf-disc
  - nnrf-disc:nf-instances:read-complete-profile
paths:
  /nf-instances:
    get:
      operationId: SearchNFInstances
      parameters:
      - description: "Accept-Encoding, described in IETF RFC 7231"
        explode: false
        in: header
        name: Accept-Encoding
        required: false
        schema:
          type: string
        style: simple
      - description: Type of the target NF
        explode: true
        in: query
        name: target-nf-type
        required: true
        schema:
          $ref: '#/components/schemas/NFType'
        style: form
      - description: Type of the requester NF
        explode: true
        in: query
        name: requester-nf-type
        required: true
        schema:
          $ref: '#/components/schemas/NFType'
        style: form
      - description: collocated NF types that candidate NFs should preferentially
          support
        explode: false
        in: query
        name: preferred-collocated-nf-types
        required: false
        schema:
          items:
            $ref: '#/components/schemas/CollocatedNfType'
          minItems: 1
          type: array
        style: form
      - description: NfInstanceId of the requester NF
        explode: true
        in: query
        name: requester-nf-instance-id
        required: false
        schema:
          $ref: '#/components/schemas/NfInstanceId'
        style: form
      - description: Names of the services offered by the NF
        explode: false
        in: query
        name: service-names
        required: false
        schema:
          items:
            $ref: '#/components/schemas/ServiceName'
          minItems: 1
          type: array
          uniqueItems: true
        style: form
      - description: FQDN of the requester NF
        explode: true
        in: query
        name: requester-nf-instance-fqdn
        required: false
        schema:
          $ref: '#/components/schemas/Fqdn'
        style: form
      - content:
          application/json:
            schema:
              items:
                $ref: '#/components/schemas/PlmnId'
              minItems: 1
              type: array
        description: |
          Id of the PLMN of either the target NF, or in SNPN scenario the Credentials Holder in the PLMN
        in: query
        name: target-plmn-list
        required: false
      - content:
          application/json:
            schema:
              items:
                $ref: '#/components/schemas/PlmnId'
              minItems: 1
              type: array
        description: Id of the PLMN where the NF issuing the Discovery request is
          located
        in: query
        name: requester-plmn-list
        required: false
      - description: Identity of the NF instance being discovered
        explode: true
        in: query
        name: target-nf-instance-id
        required: false
        schema:
          $ref: '#/components/schemas/NfInstanceId'
        style: form
      - description: FQDN of the NF instance being discovered
        explode: true
        in: query
        name: target-nf-fqdn
        required: false
        schema:
          $ref: '#/components/schemas/Fqdn'
        style: form
      - description: Uri of the home NRF
        explode: true
        in: query
        name: hnrf-uri
        required: false
        schema:
          $ref: '#/components/schemas/Uri'
        style: form
      - content:
          application/json:
            schema:
              items:
                $ref: '#/components/schemas/Snssai'
              minItems: 1
              type: array
        description: Slice info of the target NF
        in: query
        name: snssais
        required: false
      - content:
          application/json:
            schema:
              items:
                $ref: '#/components/schemas/ExtSnssai'
              minItems: 1
              type: array
        description: Slice info of the requester NF
        in: query
        name: requester-snssais
        required: false
      - content:
          application/json:
            schema:
              items:
                $ref: '#/components/schemas/PlmnSnssai'
              minItems: 1
              type: array
        description: PLMN specific Slice info of the target NF
        in: query
        name: plmn-specific-snssai-list
        required: false
      - content:
          application/json:
            schema:
              items:
                $ref: '#/components/schemas/PlmnSnssai'
              minItems: 1
              type: array
        description: PLMN-specific slice info of the NF issuing the Discovery request
        in: query
        name: requester-plmn-specific-snssai-list
        required: false
      - description: "Dnn supported by the BSF, SMF or UPF"
        explode: true
        in: query
        name: dnn
        required: false
        schema:
          $ref: '#/components/schemas/Dnn'
        style: form
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/IpIndex'
        description: The IPv4 Index supported by the candidate UPF.
        in: query
        name: ipv4-index
        required: false
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/IpIndex'
        description: The IPv6 Index supported by the candidate UPF.
        in: query
        name: ipv6-index
        required: false
      - description: NSI IDs that are served by the services being discovered
        explode: false
        in: query
        name: nsi-list
        required: false
        schema:
          items:
            type: string
          minItems: 1
          type: array
        style: form
      - explode: true
        in: query
        name: smf-serving-area
        required: false
        schema:
          type: string
        style: form
      - explode: true
        in: query
        name: mbsmf-serving-area
        required: false
        schema:
          type: string
        style: form
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/Tai'
        description: Tracking Area Identity
        in: query
        name: tai
        required: false
      - description: AMF Region Identity
        explode: true
        in: query
        name: amf-region-id
        required: false
        schema:
          $ref: '#/components/schemas/AmfRegionId'
        style: form
      - description: AMF Set Identity
        explode: true
        in: query
        name: amf-set-id
        required: false
        schema:
          $ref: '#/components/schemas/AmfSetId'
        style: form
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/Guami'
        description: Guami used to search for an appropriate AMF
        in: query
        name: guami
        required: false
      - description: SUPI of the user
        explode: true
        in: query
        name: supi
        required: false
        schema:
          $ref: '#/components/schemas/Supi'
        style: form
      - description: IPv4 address of the UE
        explode: true
        in: query
        name: ue-ipv4-address
        required: false
        schema:
          $ref: '#/components/schemas/Ipv4Addr'
        style: form
      - description: "IP domain of the UE, which supported by BSF"
        explode: true
        in: query
        name: ip-domain
        required: false
        schema:
          type: string
        style: form
      - description: IPv6 prefix of the UE
        explode: true
        in: query
        name: ue-ipv6-prefix
        required: false
        schema:
          $ref: '#/components/schemas/Ipv6Prefix'
        style: form
      - description: Combined PGW-C and SMF or a standalone SMF
        explode: true
        in: query
        name: pgw-ind
        required: false
        schema:
          type: boolean
        style: form
      - description: Indicates combined PGW-C+SMF or standalone SMF are preferred
        explode: true
        in: query
        name: preferred-pgw-ind
        required: false
        schema:
          type: boolean
        style: form
      - description: PGW FQDN of a combined PGW-C and SMF
        explode: true
        in: query
        name: pgw
        required: false
        schema:
          $ref: '#/components/schemas/Fqdn'
        style: form
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/IpAddr'
        description: PGW IP Address of a combined PGW-C and SMF
        in: query
        name: pgw-ip
        required: false
      - description: GPSI of the user
        explode: true
        in: query
        name: gpsi
        required: false
        schema:
          $ref: '#/components/schemas/Gpsi'
        style: form
      - description: external group identifier of the user
        explode: true
        in: query
        name: external-group-identity
        required: false
        schema:
          $ref: '#/components/schemas/ExtGroupId'
        style: form
      - description: internal group identifier of the user
        explode: true
        in: query
        name: internal-group-identity
        required: false
        schema:
          $ref: '#/components/schemas/GroupId'
        style: form
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/PfdData'
        description: PFD data
        in: query
        name: pfd-data
        required: false
      - description: data set supported by the NF
        explode: true
        in: query
        name: data-set
        required: false
        schema:
          $ref: '#/components/schemas/DataSetId'
        style: form
      - description: routing indicator in SUCI
        explode: true
        in: query
        name: routing-indicator
        required: false
        schema:
          pattern: "^[0-9]{1,4}$"
          type: string
        style: form
      - description: Group IDs of the NFs being discovered
        explode: false
        in: query
        name: group-id-list
        required: false
        schema:
          items:
            $ref: '#/components/schemas/NfGroupId'
          minItems: 1
          type: array
        style: form
      - description: Data network access identifiers of the NFs being discovered
        explode: false
        in: query
        name: dnai-list
        required: false
        schema:
          items:
            $ref: '#/components/schemas/Dnai'
          minItems: 1
          type: array
        style: form
      - description: list of PDU Session Type required to be supported by the target
          NF
        explode: false
        in: query
        name: pdu-session-types
        required: false
        schema:
          items:
            $ref: '#/components/schemas/PduSessionType'
          minItems: 1
          type: array
        style: form
      - description: |
          Analytics event(s) requested to be supported by the Nnwdaf_AnalyticsInfo service
        explode: false
        in: query
        name: event-id-list
        required: false
        schema:
          items:
            $ref: '#/components/schemas/EventId'
          minItems: 1
          type: array
        style: form
      - description: |
          Analytics event(s) requested to be supported by the Nnwdaf_EventsSubscription service.
        explode: false
        in: query
        name: nwdaf-event-list
        required: false
        schema:
          items:
            $ref: '#/components/schemas/NwdafEvent'
          minItems: 1
          type: array
        style: form
      - description: Features required to be supported by the target NF
        explode: true
        in: query
        name: supported-features
        required: false
        schema:
          $ref: '#/components/schemas/SupportedFeatures'
        style: form
      - description: UPF supporting interworking with EPS or not
        explode: true
        in: query
        name: upf-iwk-eps-ind
        required: false
        schema:
          type: boolean
        style: form
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/PlmnId'
        description: PLMN ID supported by a CHF
        in: query
        name: chf-supported-plmn
        required: false
      - description: preferred target NF location
        explode: true
        in: query
        name: preferred-locality
        required: false
        schema:
          type: string
        style: form
      - content:
          application/json:
            schema:
              additionalProperties:
                items:
                  $ref: '#/components/schemas/LocalityDescription'
                minItems: 1
                type: array
              minProperties: 1
              type: object
        description: |
          preferred target NF location A map (list of key-value pairs) where the key of the map represents the relative priority, for the requester, of each locality description among the list of locality descriptions in this query parameter, encoded as "1" (highest priority"), "2", "3", …,  "n" (lowest priority)
        in: query
        name: ext-preferred-locality
        required: false
      - description: AccessType supported by the target NF
        explode: true
        in: query
        name: access-type
        required: false
        schema:
          $ref: '#/components/schemas/AccessType'
        style: form
      - description: Maximum number of NFProfiles to return in the response
        explode: true
        in: query
        name: limit
        required: false
        schema:
          minimum: 1
          type: integer
        style: form
      - description: Features required to be supported by the target NF
        explode: false
        in: query
        name: required-features
        required: false
        schema:
          items:
            $ref: '#/components/schemas/SupportedFeatures'
          minItems: 1
          type: array
        style: form
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/ComplexQuery'
        description: the complex query condition expression
        in: query
        name: complex-query
        required: false
      - description: Maximum payload size of the response expressed in kilo octets
        explode: true
        in: query
        name: max-payload-size
        required: false
        schema:
          default: 124
          maximum: 2000
          type: integer
        style: form
      - description: |
          Extended query for maximum payload size of the response expressed in kilo octets
        explode: true
        in: query
        name: max-payload-size-ext
        required: false
        schema:
          default: 124
          type: integer
        style: form
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/AtsssCapability'
        description: ATSSS Capability
        in: query
        name: atsss-capability
        required: false
      - description: UPF supporting allocating UE IP addresses/prefixes
        explode: true
        in: query
        name: upf-ue-ip-addr-ind
        required: false
        schema:
          type: boolean
        style: form
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/ExternalClientType'
        description: Requested client type served by the NF
        in: query
        name: client-type
        required: false
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/LMFIdentification'
        description: LMF identification to be discovered
        in: query
        name: lmf-id
        required: false
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/AnNodeType'
        description: Requested AN node type served by the NF
        in: query
        name: an-node-type
        required: false
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/RatType'
        description: Requested RAT type served by the NF
        in: query
        name: rat-type
        required: false
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/Tai'
        description: preferred Tracking Area Identity
        in: query
        name: preferred-tai
        required: false
      - description: preferred NF Instances
        explode: false
        in: query
        name: preferred-nf-instances
        required: false
        schema:
          items:
            $ref: '#/components/schemas/NfInstanceId'
          minItems: 1
          type: array
        style: form
      - description: "Validator for conditional requests, as described in IETF RFC\
          \ 7232, 3.2"
        explode: false
        in: header
        name: If-None-Match
        required: false
        schema:
          type: string
        style: simple
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/PlmnIdNid'
        description: "Target SNPN Identity, or the Credentials Holder in the SNPN"
        in: query
        name: target-snpn
        required: false
      - content:
          application/json:
            schema:
              items:
                $ref: '#/components/schemas/PlmnIdNid'
              minItems: 1
              type: array
        description: SNPN ID(s) of the NF instance issuing the Discovery request
        in: query
        name: requester-snpn-list
        required: false
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/AfEventExposureData'
        description: NEF exposured by the AF
        in: query
        name: af-ee-data
        required: false
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/WAgfInfo'
        description: UPF collocated with W-AGF
        in: query
        name: w-agf-info
        required: false
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/TngfInfo'
        description: UPF collocated with TNGF
        in: query
        name: tngf-info
        required: false
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/TwifInfo'
        description: UPF collocated with TWIF
        in: query
        name: twif-info
        required: false
      - description: Target NF Set ID
        explode: true
        in: query
        name: target-nf-set-id
        required: false
        schema:
          $ref: '#/components/schemas/NfSetId'
        style: form
      - description: Target NF Service Set ID
        explode: true
        in: query
        name: target-nf-service-set-id
        required: false
        schema:
          $ref: '#/components/schemas/NfServiceSetId'
        style: form
      - description: NEF ID
        explode: true
        in: query
        name: nef-id
        required: false
        schema:
          $ref: '#/components/schemas/NefId'
        style: form
      - description: Notification Type
        explode: true
        in: query
        name: notification-type
        required: false
        schema:
          $ref: '#/components/schemas/NotificationType'
        style: form
      - description: N1 Message Class
        explode: true
        in: query
        name: n1-msg-class
        required: false
        schema:
          $ref: '#/components/schemas/N1MessageClass'
        style: form
      - description: N2 Information Class
        explode: true
        in: query
        name: n2-info-class
        required: false
        schema:
          $ref: '#/components/schemas/N2InformationClass'
        style: form
      - description: areas that can be served by the target NF
        explode: false
        in: query
        name: serving-scope
        required: false
        schema:
          items:
            type: string
          minItems: 1
          type: array
        style: form
      - description: IMSI of the requester UE to search for an appropriate NF (e.g.
          HSS)
        explode: true
        in: query
        name: imsi
        required: false
        schema:
          pattern: "^[0-9]{5,15}$"
          type: string
        style: form
      - description: IMPI of the requester UE to search for a target HSS
        explode: true
        in: query
        name: ims-private-identity
        required: false
        schema:
          type: string
        style: form
      - description: IMS Public Identity of the requester UE to search for a target
          HSS
        explode: true
        in: query
        name: ims-public-identity
        required: false
        schema:
          type: string
        style: form
      - description: MSISDN of the requester UE to search for a target HSS
        explode: true
        in: query
        name: msisdn
        required: false
        schema:
          type: string
        style: form
      - content:
          application/json:
            schema:
              additionalProperties:
                type: string
              description: A map (list of key-value pairs) where ServiceName serves
                as key
              minProperties: 1
              type: object
        description: Preferred API version of the services to be discovered
        in: query
        name: preferred-api-versions
        required: false
      - description: PCF supports V2X
        explode: true
        in: query
        name: v2x-support-ind
        required: false
        schema:
          type: boolean
        style: form
      - description: UPF supports redundant gtp-u to be discovered
        explode: true
        in: query
        name: redundant-gtpu
        required: false
        schema:
          type: boolean
        style: form
      - description: UPF supports redundant transport path to be discovered
        explode: true
        in: query
        name: redundant-transport
        required: false
        schema:
          type: boolean
        style: form
      - description: UPF which is configured for IPUPS functionality to be discovered
        explode: true
        in: query
        name: ipups
        required: false
        schema:
          type: boolean
        style: form
      - description: UPF which is configured to support sxa interface
        explode: true
        in: query
        name: sxa-ind
        required: false
        schema:
          type: boolean
        style: form
      - description: SCP domains the target SCP or SEPP belongs to
        explode: false
        in: query
        name: scp-domain-list
        required: false
        schema:
          items:
            type: string
          minItems: 1
          type: array
        style: form
      - description: Address domain reachable through the SCP
        explode: true
        in: query
        name: address-domain
        required: false
        schema:
          $ref: '#/components/schemas/Fqdn'
        style: form
      - description: IPv4 address reachable through the SCP
        explode: true
        in: query
        name: ipv4-addr
        required: false
        schema:
          $ref: '#/components/schemas/Ipv4Addr'
        style: form
      - description: IPv6 prefix reachable through the SCP
        explode: true
        in: query
        name: ipv6-prefix
        required: false
        schema:
          $ref: '#/components/schemas/Ipv6Prefix'
        style: form
      - description: NF Set ID served by the SCP
        explode: true
        in: query
        name: served-nf-set-id
        required: false
        schema:
          $ref: '#/components/schemas/NfSetId'
        style: form
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/PlmnId'
        description: Id of the PLMN reachable through the SCP or SEPP
        in: query
        name: remote-plmn-id
        required: false
      - content:
          application/json:
            schema:
              $ref: '#/components/schemas/PlmnIdNid'
        description: Id of the SNPN reachable through the SCP or SEPP
        in: query
        name: remote-snpn-id
        required: false
      - description: UPF Instance(s) configured for data forwarding are requested
        explode: true
        in: query
        name: data-forwarding
        required: false
        schema:
          type: boolean
        style: form
      - description: NF Instance(s) serving the full PLMN are preferred
        explode: true
        in: query
        name: preferred-full-plmn
        required: false
        schema:
          type: boolean
        style: form
      - description: |
          Features supported by the NF Service Consumer that is invoking the Nnrf_NFDiscovery service
        explode: true
        in: query
        name: requester-features
        required: false
        schema:
          $ref: '#/components/schemas/SupportedFeatures'
        style: form
      - description: realm-id to search for an appropriate UDSF
        explode: true
        in: query
        name: realm-id
        required: false
        schema:
          type: string
        style: form
      - description: storage-id to search for an appropriate UDSF
        explode: true
        in: query
        name: storage-id
        required: false
        schema:
          type: string
        style: form
      - description: V-SMF capability supported by the target NF instance(s)
        explode: true
        in: query
        name: vsmf-support-ind
        required: false
        schema:
          type: boolean
        style: form
      - description: I-SMF capability supported by the target NF instance(s)
        explode: true
        in: query
        name: ismf-support-ind
        required: false
        schema:
          type: boolean
        style: form
      - description: Uri of the NRF holding the NF profile of a target NF Instance
        explode: true
        in: query
        name: nrf-disc-uri
        required: false
        schema:
          $ref: '#/components/schemas/Uri'
        style: form
      - content:
          application/json:
            schema:
              additionalProperties:
                additionalProperties:
                  items:
                    $ref: '#/components/schemas/VendorSpecificFeature'
                  minItems: 1
                  type: array
                description: |
                  A map (list of key-value pairs) where IANA-assigned SMI Network Management Private Enterprise Codes serves as key
                minProperties: 1
                type: object
              description: A map (list of key-value pairs) where ServiceName serves
                as key
              minProperties: 1
              type: object
        description: Preferred vendor specific features of the services to be discovered
        in: query
        name: preferred-vendor-specific-features
        required: false
      - content:
          application/json:
            schema:
              additionalProperties:
                items:
