        - COLLECTIVE_BEHAVIOUR
        - MS_QOE_METRICS
        - MS_CONSUMPTION
        - MS_NET_ASSIST_INVOCATION
        - MS_DYN_POLICY_INVOCATION
        - MS_ACCESS_ACTIVITY
        type: string
      - description: |
          This string provides forward-compatibility with future extensions to the enumeration but is not used to encode content defined in the present version of this API.
        type: string
      description: Represents Application Events.
    AccessTokenErr:
      description: Error returned in the access token response message
      properties:
        error:
          enum:
          - invalid_request
          - invalid_client
          - invalid_grant
          - unauthorized_client
          - unsupported_grant_type
          - invalid_scope
          type: string
        error_description:
          type: string
        error_uri:
          type: string
      required:
      - error
      type: object
    AccessTokenReq:
      description: Contains information related to the access token request
      properties:
        grant_type:
          enum:
          - client_credentials
          type: string
        nfInstanceId:
          description: "String uniquely identifying a NF instance. The format of the\
            \ NF Instance ID shall be a  Universally Unique Identifier (UUID) version\
            \ 4, as described in IETF RFC 4122. \n"
          format: uuid
          type: string
        nfType:
          $ref: '#/components/schemas/NFType'
        targetNfType:
          $ref: '#/components/schemas/NFType'
        scope:
          pattern: "^([a-zA-Z0-9_:-]+)( [a-zA-Z0-9_:-]+)*$"
          type: string
        targetNfInstanceId:
          description: "String uniquely identifying a NF instance. The format of the\
            \ NF Instance ID shall be a  Universally Unique Identifier (UUID) version\
            \ 4, as described in IETF RFC 4122. \n"
          format: uuid
          type: string
        requesterPlmn:
          $ref: '#/components/schemas/PlmnId'
        requesterPlmnList:
          items:
            $ref: '#/components/schemas/PlmnId'
          minItems: 2
          type: array
        requesterSnssaiList:
          items:
            $ref: '#/components/schemas/Snssai'
          minItems: 1
          type: array
        requesterFqdn:
          description: Fully Qualified Domain Name
          maxLength: 253
          minLength: 4
          pattern: "^([0-9A-Za-z]([-0-9A-Za-z]{0,61}[0-9A-Za-z])?\\.)+[A-Za-z]{2,63}\\\
            .?$"
          type: string
        requesterSnpnList:
          items:
            $ref: '#/components/schemas/PlmnIdNid'
          minItems: 1
          type: array
        targetPlmn:
          $ref: '#/components/schemas/PlmnId'
        targetSnpn:
          $ref: '#/components/schemas/PlmnIdNid'
        targetSnssaiList:
          items:
            $ref: '#/components/schemas/Snssai'
          minItems: 1
          type: array
        targetNsiList:
          items:
            type: string
          minItems: 1
          type: array
        targetNfSetId:
          description: "NF Set Identifier (see clause 28.12 of 3GPP TS 23.003), formatted\
            \ as the following string \"set<Set ID>.<nftype>set.5gc.mnc<MNC>.mcc<MCC>\"\
            , or  \"set<SetID>.<NFType>set.5gc.nid<NID>.mnc<MNC>.mcc<MCC>\" with \
            \ <MCC> encoded as defined in clause 5.4.2 (\"Mcc\" data type definition)\
            \  <MNC> encoding the Mobile Network Code part of the PLMN, comprising\
            \ 3 digits. \n  If there are only 2 significant digits in the MNC, one\
            \ \"0\" digit shall be inserted \n  at the left side to fill the 3 digits\
            \ coding of MNC.  Pattern: '^[0-9]{3}$'\n<NFType> encoded as a value defined\
            \ in Table 6.1.6.3.3-1 of 3GPP TS 29.510 but \n  with lower case characters\
            \ <Set ID> encoded as a string of characters consisting of \n  alphabetic\
            \ characters (A-Z and a-z), digits (0-9) and/or the hyphen (-) and that\
            \ \n  shall end with either an alphabetic character or a digit. \n"
          type: string
        targetNfServiceSetId:
          description: "NF Service Set Identifier (see clause 28.12 of 3GPP TS 23.003)\
            \ formatted as the following  string \"set<Set ID>.sn<Service Name>.nfi<NF\
            \ Instance ID>.5gc.mnc<MNC>.mcc<MCC>\", or  \"set<SetID>.sn<ServiceName>.nfi<NFInstanceID>.5gc.nid<NID>.mnc<MNC>.mcc<MCC>\"\
            \ with  <MCC> encoded as defined in clause 5.4.2 (\"Mcc\" data type definition)\
            \   <MNC> encoding the Mobile Network Code part of the PLMN, comprising\
            \ 3 digits. \n  If there are only 2 significant digits in the MNC, one\
            \ \"0\" digit shall be inserted \n  at the left side to fill the 3 digits\
            \ coding of MNC.  Pattern: '^[0-9]{3}$'\n<NID> encoded as defined in clause\_\
            5.4.2 (\"Nid\" data type definition)  <NFInstanceId> encoded as defined\
            \ in clause 5.3.2  <ServiceName> encoded as defined in 3GPP TS 29.510\
            \  <Set ID> encoded as a string of characters consisting of alphabetic\
            \ \n  characters (A-Z and a-z), digits (0-9) and/or the hyphen (-) and\
            \ that shall end \n  with either an alphabetic character or a digit.\n"
          type: string
        hnrfAccessTokenUri:
          description: String providing an URI formatted according to RFC 3986.
          type: string
        sourceNfInstanceId:
          description: "String uniquely identifying a NF instance. The format of the\
            \ NF Instance ID shall be a  Universally Unique Identifier (UUID) version\
            \ 4, as described in IETF RFC 4122. \n"
          format: uuid
          type: string
      required:
      - grant_type
      - nfInstanceId
      - scope
      type: object
    AmfName:
      $ref: '#/components/schemas/Fqdn'
    WildcardDnn:
      description: String representing the Wildcard DNN. It shall contain the string
        "*".
      pattern: "^[*]$"
      type: string
    DiameterIdentity:
      $ref: '#/components/schemas/Fqdn'
    NetworkNodeDiameterAddress:
      example:
        name: name
        realm: realm
      properties:
        name:
          description: Fully Qualified Domain Name
          maxLength: 253
          minLength: 4
          pattern: "^([0-9A-Za-z]([-0-9A-Za-z]{0,61}[0-9A-Za-z])?\\.)+[A-Za-z]{2,63}\\\
            .?$"
          type: string
        realm:
          description: Fully Qualified Domain Name
          maxLength: 253
          minLength: 4
          pattern: "^([0-9A-Za-z]([-0-9A-Za-z]{0,61}[0-9A-Za-z])?\\.)+[A-Za-z]{2,63}\\\
            .?$"
          type: string
      required:
      - name
      - realm
      type: object
    SupportedGADShapes:
      anyOf:
      - enum:
        - POINT
        - POINT_UNCERTAINTY_CIRCLE
        - POINT_UNCERTAINTY_ELLIPSE
        - POLYGON
        - POINT_ALTITUDE
        - POINT_ALTITUDE_UNCERTAINTY
        - ELLIPSOID_ARC
        - LOCAL_2D_POINT_UNCERTAINTY_ELLIPSE
        - LOCAL_3D_POINT_UNCERTAINTY_ELLIPSOID
        type: string
      - type: string
      description: Indicates supported GAD shapes.
    MbsServiceAreaInfo:
      description: MBS Service Area Information for location dependent MBS session
      example:
        mbsServiceArea:
          ncgiList:
          - cellList:
            - nid: nid
              plmnId:
                mnc: mnc
                mcc: mcc
              nrCellId: nrCellId
            - nid: nid
              plmnId:
                mnc: mnc
                mcc: mcc
              nrCellId: nrCellId
            tai:
              tac: tac
              nid: nid
              plmnId:
                mnc: mnc
                mcc: mcc
          - cellList:
            - nid: nid
              plmnId:
                mnc: mnc
                mcc: mcc
              nrCellId: nrCellId
            - nid: nid
              plmnId:
                mnc: mnc
                mcc: mcc
              nrCellId: nrCellId
            tai:
              tac: tac
              nid: nid
              plmnId:
                mnc: mnc
                mcc: mcc
          taiList:
          - tac: tac
            nid: nid
            plmnId:
              mnc: mnc
              mcc: mcc
          - tac: tac
            nid: nid
            plmnId:
              mnc: mnc
              mcc: mcc
        areaSessionId: 48874
      properties:
        areaSessionId:
          description: Integer where the allowed values correspond to the value range
            of an unsigned 16-bit integer.
          maximum: 65535
          minimum: 0
          type: integer
        mbsServiceArea:
          $ref: '#/components/schemas/MbsServiceArea'
      required:
      - areaSessionId
      - mbsServiceArea
      type: object
    MbsServiceArea:
      anyOf:
      - required:
        - ncgiList
      - required:
        - taiList
      description: MBS Service Area
      example:
        ncgiList:
        - cellList:
          - nid: nid
            plmnId:
              mnc: mnc
              mcc: mcc
            nrCellId: nrCellId
          - nid: nid
            plmnId:
              mnc: mnc
              mcc: mcc
            nrCellId: nrCellId
          tai:
            tac: tac
            nid: nid
            plmnId:
              mnc: mnc
              mcc: mcc
        - cellList:
          - nid: nid
            plmnId:
              mnc: mnc
              mcc: mcc
            nrCellId: nrCellId
          - nid: nid
            plmnId:
              mnc: mnc
              mcc: mcc
            nrCellId: nrCellId
          tai:
            tac: tac
            nid: nid
            plmnId:
              mnc: mnc
              mcc: mcc
        taiList:
        - tac: tac
          nid: nid
          plmnId:
            mnc: mnc
            mcc: mcc
        - tac: tac
          nid: nid
          plmnId:
            mnc: mnc
            mcc: mcc
      properties:
        ncgiList:
          description: List of NR cell Ids
          items:
            $ref: '#/components/schemas/NcgiTai'
          minItems: 1
          type: array
        taiList:
          description: List of tracking area Ids
          items:
            $ref: '#/components/schemas/Tai'
          minItems: 1
          type: array
      type: object
    NcgiTai:
      description: "List of NR cell ids, with their pertaining TAIs"
      example:
        cellList:
        - nid: nid
          plmnId:
            mnc: mnc
            mcc: mcc
          nrCellId: nrCellId
        - nid: nid
          plmnId:
            mnc: mnc
            mcc: mcc
          nrCellId: nrCellId
        tai:
          tac: tac
          nid: nid
          plmnId:
            mnc: mnc
            mcc: mcc
      properties:
        tai:
          $ref: '#/components/schemas/Tai'
        cellList:
          description: List of List of NR cell ids
          items:
            $ref: '#/components/schemas/Ncgi'
          minItems: 1
          type: array
      required:
      - cellList
      - tai
      type: object
    Ncgi:
      description: "Contains the NCGI (NR Cell Global Identity), as described in 3GPP\
        \ 23.003"
      example:
        nid: nid
        plmnId:
          mnc: mnc
          mcc: mcc
        nrCellId: nrCellId
      properties:
        plmnId:
          $ref: '#/components/schemas/PlmnId'
        nrCellId:
          description: "36-bit string identifying an NR Cell Id as specified in clause\
            \ 9.3.1.7 of 3GPP TS 38.413,  in hexadecimal representation. Each character\
            \ in the string shall take a value of \"0\" to \"9\",  \"a\" to \"f\"\
            \ or \"A\" to \"F\" and shall represent 4 bits. The most significant character\
            \  representing the 4 most significant bits of the Cell Id shall appear\
            \ first in the string, and  the character representing the 4 least significant\
            \ bit of the Cell Id shall appear last in the  string. \n"
          pattern: "^[A-Fa-f0-9]{9}$"
          type: string
        nid:
          description: "This represents the Network Identifier, which together with\
            \ a PLMN ID is used to identify an SNPN (see 3GPP TS 23.003 and 3GPP TS\
            \ 23.501 clause 5.30.2.1). \n"
          pattern: "^[A-Fa-f0-9]{11}$"
          type: string
      required:
      - nrCellId
      - plmnId
      type: object
    NrCellId:
      description: "36-bit string identifying an NR Cell Id as specified in clause\
        \ 9.3.1.7 of 3GPP TS 38.413,  in hexadecimal representation. Each character\
        \ in the string shall take a value of \"0\" to \"9\",  \"a\" to \"f\" or \"\
        A\" to \"F\" and shall represent 4 bits. The most significant character  representing\
        \ the 4 most significant bits of the Cell Id shall appear first in the string,\
        \ and  the character representing the 4 least significant bit of the Cell\
        \ Id shall appear last in the  string. \n"
      pattern: "^[A-Fa-f0-9]{9}$"
      type: string
